  \"dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-fro94188\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112248 includes chemical,
  discrete sample, physical and profile data collected from NATSUSHIMA in the North
  Pacific Ocean from 2003-07-05 to 2003-07-18 and retrieved during cruise 49NB20030705
  and NT03-07. These data include ALKALINITY, AMMONIUM, DISSOLVED INORGANIC CARBON,
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, SALINITY, SILICATE,
  WATER TEMPERATURE and pH. The instruments used to collect these data include CTD,
  Coulometer for DIC measurement and bottle. These data were collected by Nobuo Tsurushima
  of Advanced Industrial Science and Technology and Hajime Kawakami of Japan Agency
  for Marine-Earth Science and Technology (Jamstec) as part of the PACIFICA_49NB20030705
  data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
  project for the data synthesis of ocean interior carbon and its related parameters
  in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
  of Carbon and Climate (S-CC) supported the project.\",\n\t\"license_title\": null,\n\t\"extras\":
